import React from "react";
import ReactDOM from "react-dom";
import "./App.css";
import App from "./App";

import "bootstrap/dist/css/bootstrap.min.css";

import { Account } from "./components/Authentication/Account";

ReactDOM.render(
  <Account>
    <App />
  </Account>,

  document.getElementById("root")
);
